import PhotoStrip from "./PhotoStrip";
import "./App.css";
import LivePhoto from "./LivePhoto";
import { useEffect, useState } from "react";

function App() {
    const [sessionPhotos, setSessionPhotos] = useState([]);
    const getData = () => {
        fetch("http://localhost:8000/data")
            .then((res) => res.json())
            .then(
                (result) => {
                    console.log(result);
                    setSessionPhotos(result.currentCapture);
                },
                (error) => {
                    console.log(error);
                }
            );
    };
    useEffect(() => {
        getData();
    }, []);
    console.log("app");
    return (
        <Grid item xs={12} md={8}>
            <LivePhoto getData={getData} />
            <br />
            <PhotoStrip photos={sessionPhotos} />
        </Grid>
    );
}

export default App;
